*The Brazilian people and the national press were censored by the Supreme Court, which is blocking the social networks of businessmen and decreeing the arrest of politicians opposed to the Lula government, who, despite having been convicted and imprisoned for corruption, was released through a autocracy decision of a supreme court minister and elected president in an election with many indications of fraud. We need the world to know what is really happening in Brazil. please help us!*
